const Tasks = [
    {
        id :'1' ,
        text : 'studing js',
        reminder : 'true',
    },
    {
        id :'2' ,
        text : 'studing js',
        reminder : 'false',
    },
    {
        id :'3' ,
        text : 'studing js',
        reminder : 'true',
    }
]

export const  Task = () => {
  return (
    <>
      {Tasks.map((task) => (<h3 style={{color:Black}} key={Tasks.id}>{Tasks.text}</h3>))}
    </>
  )
}
